import React from "react";
import { Link } from "react-router-dom"; // React RouterからLinkをインポート
import "./Home.css";
import background from "./AdobeStock_238865078.jpeg";

const Home = () => {
  return (
    <div style={{
      background: `url(${background}) center`,
      backgroundSize: 'cover'
      }}>
      <h1>ホーム画面だよ！</h1>
      <Link to="/signin">
        <button>Sigin</button>
      </Link>
    </div>
    );
  };

export default Home;
